import { productsType } from "../types/Types";
export const filterProductsData = (product: productsType[]): productsType[] => {

  const filteredProducts: productsType[] = product.map((product) => ({    
    id: product.id,
    description: product.description,
    image: product.image,
    price: Math.floor(product.price),
    title: product.title,
    count: 1,
  })
);

  return filteredProducts
}
